"use strict";(self.webpackChunkunesco=self.webpackChunkunesco||[]).push([[486],{486:t=>{t.exports=JSON.parse('[{"year1":"1983","title1":"\u0411\u0435\u043d\u0435\u0434\u0438\u043a\u0442\u0438\u043d\u0441\u044c\u043a\u0438\u0439 \u043c\u043e\u043d\u0430\u0441\u0442\u0438\u0440 \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u0406\u043e\u0430\u043d\u043d\u0430 \u0432 \u041c\u044e\u0441\u0442\u0435\u0440\u0456","text1":"\u041c\u043e\u043d\u0430\u0441\u0442\u0438\u0440 \u041c\u044e\u0441\u0442\u0435\u0440, \u044f\u043a\u0438\u0439 \u0441\u0442\u043e\u0457\u0442\u044c \u0443 \u0434\u043e\u043b\u0438\u043d\u0456 \u0413\u0440\u0430\u0443\u0431\u044e\u043d\u0434\u0435\u043d\u0456\u0432, \u0454 \u0433\u0430\u0440\u043d\u0438\u043c \u043f\u0440\u0438\u043a\u043b\u0430\u0434\u043e\u043c \u0445\u0440\u0438\u0441\u0442\u0438\u044f\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u043c\u043e\u043d\u0430\u0441\u0442\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e \u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0432 \u043f\u0435\u0440\u0456\u043e\u0434 \u041a\u0430\u0440\u043e\u043b\u0456\u043d\u0433\u0456\u0432. \u0412\u0456\u043d \u043c\u0430\u0454 \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448\u0443 \u0432 \u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0456\u0457 \u0441\u0435\u0440\u0456\u044e \u0444\u0456\u0433\u0443\u0440\u043d\u0438\u0445 \u0444\u0440\u0435\u0441\u043e\u043a, \u043d\u0430\u043c\u0430\u043b\u044c\u043e\u0432\u0430\u043d\u0438\u0445 \u0431\u043b. 800 \u0440. \u043d.\u0435. \u0440\u0430\u0437\u043e\u043c \u0456\u0437 \u0440\u043e\u043c\u0430\u043d\u0441\u044c\u043a\u0438\u043c\u0438 \u0444\u0440\u0435\u0441\u043a\u0430\u043c\u0438 \u0442\u0430 \u043b\u0456\u043f\u043d\u0438\u043d\u043e\u044e.","year2":"1983","title2":"\u0410\u0431\u0430\u0442\u0441\u0442\u0432\u043e \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u0413\u0430\u043b\u043b\u0430","text2":"\u041c\u043e\u043d\u0430\u0441\u0442\u0438\u0440 \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u0413\u0430\u043b\u043b\u0430, \u043f\u0440\u0435\u043a\u0440\u0430\u0441\u043d\u0438\u0439 \u043f\u0440\u0438\u043a\u043b\u0430\u0434 \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043a\u0430\u0440\u043e\u043b\u0456\u043d\u0433\u0441\u044c\u043a\u043e\u0433\u043e \u043c\u043e\u043d\u0430\u0441\u0442\u0438\u0440\u044f, \u0431\u0443\u0432 \u043e\u0434\u043d\u0438\u043c \u0456\u0437 \u043d\u0430\u0439\u0432\u0430\u0436\u043b\u0438\u0432\u0456\u0448\u0438\u0445 \u0443 \u0404\u0432\u0440\u043e\u043f\u0456 \u0437 VIII \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f \u0434\u043e \u0441\u0435\u043a\u0443\u043b\u044f\u0440\u0438\u0437\u0430\u0446\u0456\u0457 \u0432 1805 \u0440\u043e\u0446\u0456. \u0419\u043e\u0433\u043e \u0431\u0456\u0431\u043b\u0456\u043e\u0442\u0435\u043a\u0430 \u0454 \u043e\u0434\u043d\u0456\u0454\u044e \u0437 \u043d\u0430\u0439\u0431\u0430\u0433\u0430\u0442\u0448\u0438\u0445 \u0456 \u043d\u0430\u0439\u0441\u0442\u0430\u0440\u0456\u0448\u0438\u0445 \u0443 \u0441\u0432\u0456\u0442\u0456 \u0442\u0430 \u043c\u0456\u0441\u0442\u0438\u0442\u044c \u0434\u043e\u0440\u043e\u0433\u043e\u0446\u0456\u043d\u043d\u0456 \u0440\u0443\u043a\u043e\u043f\u0438\u0441\u0438, \u0442\u0430\u043a\u0456 \u044f\u043a \u043d\u0430\u0439\u0434\u0430\u0432\u043d\u0456\u0448\u0438\u0439 \u0432\u0456\u0434\u043e\u043c\u0438\u0439 \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u0438\u0439 \u043f\u043b\u0430\u043d, \u043d\u0430\u043c\u0430\u043b\u044c\u043e\u0432\u0430\u043d\u0438\u0439 \u043d\u0430 \u043f\u0435\u0440\u0433\u0430\u043c\u0435\u043d\u0442\u0456. \u0417 1755 \u043f\u043e 1768 \u0440\u0456\u043a \u043c\u043e\u043d\u0430\u0441\u0442\u0438\u0440\u0441\u044c\u043a\u0443 \u043f\u043b\u043e\u0449\u0443 \u0431\u0443\u043b\u043e \u043f\u0435\u0440\u0435\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u043e \u0432 \u0441\u0442\u0438\u043b\u0456 \u0431\u0430\u0440\u043e\u043a\u043e. \u041a\u0430\u0444\u0435\u0434\u0440\u0430\u043b\u044c\u043d\u0438\u0439 \u0441\u043e\u0431\u043e\u0440 \u0456 \u0431\u0456\u0431\u043b\u0456\u043e\u0442\u0435\u043a\u0430 \u0454 \u0433\u043e\u043b\u043e\u0432\u043d\u0438\u043c\u0438 \u0435\u043b\u0435\u043c\u0435\u043d\u0442\u0430\u043c\u0438 \u0446\u044c\u043e\u0433\u043e \u0447\u0443\u0434\u043e\u0432\u043e\u0433\u043e \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u043e\u0433\u043e \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441\u0443, \u0449\u043e \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0454 12 \u0441\u0442\u043e\u043b\u0456\u0442\u044c \u0431\u0435\u0437\u043f\u0435\u0440\u0435\u0440\u0432\u043d\u043e\u0457 \u0434\u0456\u044f\u043b\u044c\u043d\u043e\u0441\u0442\u0456."},{"year1":"1983","title1":"\u0421\u0442\u0430\u0440\u0435 \u043c\u0456\u0441\u0442\u043e \u0411\u0435\u0440\u043d","text1":"\u0417\u0430\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0439 \u0443 12 \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u0456 \u043d\u0430 \u043f\u0430\u0433\u043e\u0440\u0431\u0456, \u043e\u0442\u043e\u0447\u0435\u043d\u043e\u043c\u0443 \u0440\u0456\u0447\u043a\u043e\u044e \u0410\u0430\u0440\u0435, \u0411\u0435\u0440\u043d \u0440\u043e\u0437\u0432\u0438\u0432\u0430\u0432\u0441\u044f \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c \u0441\u0442\u043e\u043b\u0456\u0442\u044c \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u043d\u043e \u0434\u043e \u0432\u0438\u043d\u044f\u0442\u043a\u043e\u0432\u043e \u0443\u0437\u0433\u043e\u0434\u0436\u0435\u043d\u043e\u0457 \u043a\u043e\u043d\u0446\u0435\u043f\u0446\u0456\u0457 \u043f\u043b\u0430\u043d\u0443\u0432\u0430\u043d\u043d\u044f. \u0411\u0443\u0434\u0438\u043d\u043a\u0438 \u0421\u0442\u0430\u0440\u043e\u0433\u043e \u043c\u0456\u0441\u0442\u0430, \u0449\u043e \u0434\u0430\u0442\u0443\u044e\u0442\u044c\u0441\u044f \u0440\u0456\u0437\u043d\u0438\u043c\u0438 \u043f\u0435\u0440\u0456\u043e\u0434\u0430\u043c\u0438, \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0442\u044c \u0430\u0440\u043a\u0430\u0434\u0438 15-\u0433\u043e \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f \u0442\u0430 \u0444\u043e\u043d\u0442\u0430\u043d\u0438 16-\u0433\u043e \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f. \u0411\u0456\u043b\u044c\u0448\u0443 \u0447\u0430\u0441\u0442\u0438\u043d\u0443 \u0441\u0435\u0440\u0435\u0434\u043d\u044c\u043e\u0432\u0456\u0447\u043d\u043e\u0433\u043e \u043c\u0456\u0441\u0442\u0430 \u0431\u0443\u043b\u043e \u0432\u0456\u0434\u043d\u043e\u0432\u043b\u0435\u043d\u043e \u0443 18 \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u0456, \u0430\u043b\u0435 \u0432\u043e\u043d\u043e \u0437\u0431\u0435\u0440\u0435\u0433\u043b\u043e \u0441\u0432\u0456\u0439 \u043f\u0435\u0440\u0432\u0456\u0441\u043d\u0438\u0439 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440.","year2":"2000","title2":"\u0422\u0440\u0438 \u0437\u0430\u043c\u043a\u0438, \u043e\u0431\u043e\u0440\u043e\u043d\u043d\u0430 \u0441\u0442\u0456\u043d\u0430 \u0442\u0430 \u0432\u0430\u043b\u0438 \u0440\u0438\u043d\u043a\u043e\u0432\u043e\u0433\u043e \u043c\u0456\u0441\u0442\u0430 \u0411\u0435\u043b\u043b\u0456\u043d\u0446\u043e\u043d\u0430","text2":"\u041c\u0456\u0441\u0446\u0435 \u0411\u0435\u043b\u043b\u0456\u043d\u0446\u043e\u043d\u0430 \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 \u0433\u0440\u0443\u043f\u0438 \u0443\u043a\u0440\u0456\u043f\u043b\u0435\u043d\u044c, \u0437\u0433\u0440\u0443\u043f\u043e\u0432\u0430\u043d\u0438\u0445 \u043d\u0430\u0432\u043a\u043e\u043b\u043e \u0437\u0430\u043c\u043a\u0443 \u041a\u0430\u0441\u0442\u0435\u043b\u044c\u0433\u0440\u0430\u043d\u0434\u0435, \u044f\u043a\u0438\u0439 \u0441\u0442\u043e\u0457\u0442\u044c \u043d\u0430 \u0441\u043a\u0435\u043b\u044f\u0441\u0442\u0456\u0439 \u0432\u0435\u0440\u0448\u0438\u043d\u0456, \u0437\u0432\u0456\u0434\u043a\u0438 \u0432\u0456\u0434\u043a\u0440\u0438\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u0438\u0434 \u043d\u0430 \u0432\u0441\u044e \u0434\u043e\u043b\u0438\u043d\u0443 \u0422\u0456\u0447\u0438\u043d\u043e. \u0412\u0456\u0434 \u0437\u0430\u043c\u043a\u0443 \u0440\u044f\u0434 \u0443\u043a\u0440\u0456\u043f\u043b\u0435\u043d\u0438\u0445 \u0441\u0442\u0456\u043d \u0437\u0430\u0445\u0438\u0449\u0430\u0454 \u0441\u0442\u0430\u0440\u043e\u0434\u0430\u0432\u043d\u0454 \u043c\u0456\u0441\u0442\u043e \u0442\u0430 \u0431\u043b\u043e\u043a\u0443\u0454 \u043f\u0440\u043e\u0445\u0456\u0434 \u0447\u0435\u0440\u0435\u0437 \u0434\u043e\u043b\u0438\u043d\u0443. \u0414\u0440\u0443\u0433\u0438\u0439 \u0437\u0430\u043c\u043e\u043a (\u041c\u043e\u043d\u0442\u0435\u0431\u0435\u043b\u043b\u043e) \u0454 \u043d\u0435\u0432\u0456\u0434\'\u0454\u043c\u043d\u043e\u044e \u0447\u0430\u0441\u0442\u0438\u043d\u043e\u044e \u0443\u043a\u0440\u0456\u043f\u043b\u0435\u043d\u044c, \u0442\u043e\u0434\u0456 \u044f\u043a \u0442\u0440\u0435\u0442\u0456\u0439, \u0430\u043b\u0435 \u043e\u043a\u0440\u0435\u043c\u0438\u0439 \u0437\u0430\u043c\u043e\u043a (\u0421\u0430\u0441\u0441\u043e \u041a\u043e\u0440\u0431\u0430\u0440\u043e) \u0431\u0443\u0432 \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u0438\u0439 \u043d\u0430 \u0456\u0437\u043e\u043b\u044c\u043e\u0432\u0430\u043d\u043e\u043c\u0443 \u0441\u043a\u0435\u043b\u044f\u0441\u0442\u043e\u043c\u0443 \u0432\u0438\u0441\u0442\u0443\u043f\u0456 \u043d\u0430 \u043f\u0456\u0432\u0434\u0435\u043d\u043d\u0438\u0439 \u0441\u0445\u0456\u0434 \u0432\u0456\u0434 \u0456\u043d\u0448\u0438\u0445 \u0443\u043a\u0440\u0456\u043f\u043b\u0435\u043d\u044c."},{"year1":"2001","title1":"\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0441\u044c\u043a\u0456 \u0410\u043b\u044c\u043f\u0438 \u042e\u043d\u0433\u0444\u0440\u0430\u0443-\u0410\u043b\u0435\u0447","text1":"\u0420\u043e\u0437\u0448\u0438\u0440\u0435\u043d\u043d\u044f \u043f\u0440\u0438\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u043e\u0431\u2019\u0454\u043a\u0442\u0430 \u0432\u0441\u0435\u0441\u0432\u0456\u0442\u043d\u044c\u043e\u0457 \u0441\u043f\u0430\u0434\u0449\u0438\u043d\u0438 \u042e\u043d\u0433\u0444\u0440\u0430\u0443 \u2013 \u0410\u043b\u0435\u0447 \u2013 \u0411\u0456\u0442\u0448\u0445\u043e\u0440\u043d (\u0432\u043f\u0435\u0440\u0448\u0435 \u0432\u043d\u0435\u0441\u0435\u043d\u0435 \u0432 2001 \u0440\u043e\u0446\u0456) \u0440\u043e\u0437\u0448\u0438\u0440\u044e\u0454 \u0442\u0435\u0440\u0438\u0442\u043e\u0440\u0456\u044e \u043d\u0430 \u0441\u0445\u0456\u0434 \u0456 \u0437\u0430\u0445\u0456\u0434, \u0434\u043e\u0432\u043e\u0434\u044f\u0447\u0438 \u0457\u0457 \u043f\u043b\u043e\u0449\u0443 \u0434\u043e 82 400 \u0433\u0430, \u043f\u043e\u0440\u0456\u0432\u043d\u044f\u043d\u043e \u0437 53 900. \u041c\u0456\u0441\u0446\u0435 \u0454 \u0432\u0438\u0434\u0430\u0442\u043d\u0438\u043c \u043f\u0440\u0438\u043a\u043b\u0430\u0434\u043e\u043c \u0444\u043e\u0440\u043c\u0443\u0432\u0430\u043d\u043d\u044f \u0412\u0438\u0441\u043e\u043a\u0438\u0445 \u0410\u043b\u044c\u043f, \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0447\u0438 \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448 \u043b\u044c\u043e\u0434\u043e\u0432\u0438\u043a\u043e\u0432\u0443 \u0447\u0430\u0441\u0442\u0438\u043d\u0443 \u0433\u0456\u0440\u0441\u044c\u043a\u043e\u0433\u043e \u043c\u0430\u0441\u0438\u0432\u0443 \u0442\u0430 \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448\u0438\u0439 \u043b\u044c\u043e\u0434\u043e\u0432\u0438\u043a \u0404\u0432\u0440\u0430\u0437\u0456\u0457. \u0412\u0456\u043d \u0432\u0456\u0434\u0440\u0456\u0437\u043d\u044f\u0454\u0442\u044c\u0441\u044f \u0448\u0438\u0440\u043e\u043a\u0438\u043c \u0440\u043e\u0437\u043c\u0430\u0457\u0442\u0442\u044f\u043c \u0435\u043a\u043e\u0441\u0438\u0441\u0442\u0435\u043c, \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0447\u0438 \u043f\u043e\u0441\u043b\u0456\u0434\u043e\u0432\u043d\u0456 \u0441\u0442\u0430\u0434\u0456\u0457, \u0437\u043e\u043a\u0440\u0435\u043c\u0430 \u0447\u0435\u0440\u0435\u0437 \u0432\u0456\u0434\u0441\u0442\u0443\u043f \u043b\u044c\u043e\u0434\u043e\u0432\u0438\u043a\u0456\u0432 \u0443 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0456 \u0437\u043c\u0456\u043d\u0438 \u043a\u043b\u0456\u043c\u0430\u0442\u0443. \u0421\u0430\u0439\u0442 \u043c\u0430\u0454 \u043d\u0430\u0434\u0437\u0432\u0438\u0447\u0430\u0439\u043d\u0443 \u0443\u043d\u0456\u0432\u0435\u0440\u0441\u0430\u043b\u044c\u043d\u0443 \u0446\u0456\u043d\u043d\u0456\u0441\u0442\u044c \u044f\u043a \u0447\u0435\u0440\u0435\u0437 \u0441\u0432\u043e\u044e \u043a\u0440\u0430\u0441\u0443, \u0442\u0430\u043a \u0456 \u0447\u0435\u0440\u0435\u0437 \u0432\u0435\u043b\u0438\u043a\u0443 \u043a\u0456\u043b\u044c\u043a\u0456\u0441\u0442\u044c \u0456\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0456\u0457, \u0449\u043e \u043c\u0456\u0441\u0442\u0438\u0442\u044c\u0441\u044f \u043f\u0440\u043e \u0444\u043e\u0440\u043c\u0443\u0432\u0430\u043d\u043d\u044f \u0433\u0456\u0440 \u0456 \u043b\u044c\u043e\u0434\u043e\u0432\u0438\u043a\u0456\u0432, \u0430 \u0442\u0430\u043a\u043e\u0436 \u043f\u0440\u043e \u043f\u043e\u0442\u043e\u0447\u043d\u0456 \u0437\u043c\u0456\u043d\u0438 \u043a\u043b\u0456\u043c\u0430\u0442\u0443. \u0412\u0456\u043d \u0442\u0430\u043a\u043e\u0436 \u0454 \u043d\u0435\u043e\u0446\u0456\u043d\u0435\u043d\u043d\u0438\u043c \u0437 \u0442\u043e\u0447\u043a\u0438 \u0437\u043e\u0440\u0443 \u0435\u043a\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0438\u0445 \u0456 \u0431\u0456\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0438\u0445 \u043f\u0440\u043e\u0446\u0435\u0441\u0456\u0432, \u044f\u043a\u0456 \u0432\u0456\u043d \u0456\u043b\u044e\u0441\u0442\u0440\u0443\u0454, \u0437\u043e\u043a\u0440\u0435\u043c\u0430 \u0447\u0435\u0440\u0435\u0437 \u0441\u043f\u0430\u0434\u043a\u043e\u0454\u043c\u043d\u0456\u0441\u0442\u044c \u043f\u043b\u0430\u043d\u0456\u0432. \u0419\u043e\u0433\u043e \u0432\u0440\u0430\u0436\u0430\u044e\u0447\u0438\u0439 \u043b\u0430\u043d\u0434\u0448\u0430\u0444\u0442 \u0432\u0456\u0434\u0456\u0433\u0440\u0430\u0432 \u0432\u0430\u0436\u043b\u0438\u0432\u0443 \u0440\u043e\u043b\u044c \u0443 \u0454\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u044c\u043a\u043e\u043c\u0443 \u043c\u0438\u0441\u0442\u0435\u0446\u0442\u0432\u0456, \u043b\u0456\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u0456, \u0430\u043b\u044c\u043f\u0456\u043d\u0456\u0437\u043c\u0456 \u0442\u0430 \u0430\u043b\u044c\u043f\u0456\u0439\u0441\u044c\u043a\u043e\u043c\u0443 \u0442\u0443\u0440\u0438\u0437\u043c\u0456.","year2":"2003","title2":"\u041c\u043e\u043d\u0442\u0435-\u0421\u0430\u043d-\u0414\u0436\u043e\u0440\u0434\u0436\u043e","text2":"\u041b\u0456\u0441\u0438\u0441\u0442\u0430 \u0433\u043e\u0440\u0430 \u041c\u043e\u043d\u0442\u0435-\u0421\u0430\u043d-\u0414\u0436\u043e\u0440\u0434\u0436\u043e \u0443 \u0444\u043e\u0440\u043c\u0456 \u043f\u0456\u0440\u0430\u043c\u0456\u0434\u0438 \u0431\u0456\u043b\u044f \u043e\u0437\u0435\u0440\u0430 \u041b\u0443\u0433\u0430\u043d\u043e \u0432\u0432\u0430\u0436\u0430\u0454\u0442\u044c\u0441\u044f \u043d\u0430\u0439\u043a\u0440\u0430\u0449\u0438\u043c \u0432\u0438\u043a\u043e\u043f\u043d\u0438\u043c \u0437\u0430\u043b\u0438\u0448\u043a\u043e\u043c \u043c\u043e\u0440\u0441\u044c\u043a\u043e\u0433\u043e \u0436\u0438\u0442\u0442\u044f \u0442\u0440\u0456\u0430\u0441\u043e\u0432\u043e\u0433\u043e \u043f\u0435\u0440\u0456\u043e\u0434\u0443 (245\u2013230 \u043c\u0456\u043b\u044c\u0439\u043e\u043d\u0456\u0432 \u0440\u043e\u043a\u0456\u0432 \u0442\u043e\u043c\u0443). \u041f\u043e\u0441\u043b\u0456\u0434\u043e\u0432\u043d\u0456\u0441\u0442\u044c \u0437\u0430\u043f\u0438\u0441\u0443\u0454 \u0436\u0438\u0442\u0442\u044f \u0432 \u0441\u0435\u0440\u0435\u0434\u043e\u0432\u0438\u0449\u0456 \u0442\u0440\u043e\u043f\u0456\u0447\u043d\u043e\u0457 \u043b\u0430\u0433\u0443\u043d\u0438, \u0437\u0430\u0445\u0438\u0449\u0435\u043d\u043e\u0457 \u0442\u0430 \u0447\u0430\u0441\u0442\u043a\u043e\u0432\u043e \u0432\u0456\u0434\u043e\u043a\u0440\u0435\u043c\u043b\u0435\u043d\u043e\u0457 \u0432\u0456\u0434 \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u043e\u0433\u043e \u043c\u043e\u0440\u044f \u043c\u043e\u0440\u0441\u044c\u043a\u0438\u043c \u0440\u0438\u0444\u043e\u043c. \u0423 \u0446\u0456\u0439 \u043b\u0430\u0433\u0443\u043d\u0456 \u043f\u0440\u043e\u0446\u0432\u0456\u0442\u0430\u043b\u043e \u0440\u0456\u0437\u043d\u043e\u043c\u0430\u043d\u0456\u0442\u043d\u0435 \u043c\u043e\u0440\u0441\u044c\u043a\u0435 \u0436\u0438\u0442\u0442\u044f, \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0447\u0438 \u0440\u0435\u043f\u0442\u0438\u043b\u0456\u0439, \u0440\u0438\u0431, \u0434\u0432\u043e\u0441\u0442\u0443\u043b\u043a\u043e\u0432\u0438\u0445 \u043c\u043e\u043b\u044e\u0441\u043a\u0456\u0432, \u0430\u043c\u043e\u043d\u0456\u0442\u0456\u0432, \u0433\u043e\u043b\u043a\u043e\u0448\u043a\u0456\u0440\u0438\u0445 \u0456 \u0440\u0430\u043a\u043e\u043f\u043e\u0434\u0456\u0431\u043d\u0438\u0445. \u041e\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u043b\u0430\u0433\u0443\u043d\u0430 \u0431\u0443\u043b\u0430 \u043f\u043e\u0431\u043b\u0438\u0437\u0443 \u0441\u0443\u0448\u0456, \u043e\u0441\u0442\u0430\u043d\u043a\u0438 \u0442\u0430\u043a\u043e\u0436 \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0442\u044c \u043d\u0430\u0437\u0435\u043c\u043d\u0456 \u0441\u043a\u0430\u043c\u2019\u044f\u043d\u0456\u043b\u043e\u0441\u0442\u0456 \u0440\u0435\u043f\u0442\u0438\u043b\u0456\u0439, \u043a\u043e\u043c\u0430\u0445 \u0456 \u0440\u043e\u0441\u043b\u0438\u043d, \u0449\u043e \u0454 \u043d\u0430\u0434\u0437\u0432\u0438\u0447\u0430\u0439\u043d\u043e \u0431\u0430\u0433\u0430\u0442\u0438\u043c \u0434\u0436\u0435\u0440\u0435\u043b\u043e\u043c \u0441\u043a\u0430\u043c\u2019\u044f\u043d\u0456\u043b\u043e\u0441\u0442\u0435\u0439."},{"year1":"2007","title1":"\u0421\u0442\u0430\u0440\u043e\u0434\u0430\u0432\u043d\u0456 \u0442\u0430 \u043f\u0435\u0440\u0432\u0456\u0441\u043d\u0456 \u0431\u0443\u043a\u043e\u0432\u0456 \u043b\u0456\u0441\u0438 \u041a\u0430\u0440\u043f\u0430\u0442 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u0440\u0435\u0433\u0456\u043e\u043d\u0456\u0432 \u0404\u0432\u0440\u043e\u043f\u0438","text1":"\u0426\u044f \u0442\u0440\u0430\u043d\u0441\u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0430 \u0432\u043b\u0430\u0441\u043d\u0456\u0441\u0442\u044c \u0432\u043a\u043b\u044e\u0447\u0430\u0454 93 \u0441\u043a\u043b\u0430\u0434\u043e\u0432\u0456 \u0447\u0430\u0441\u0442\u0438\u043d\u0438 \u0443 18 \u043a\u0440\u0430\u0457\u043d\u0430\u0445. \u0417 \u043a\u0456\u043d\u0446\u044f \u043e\u0441\u0442\u0430\u043d\u043d\u044c\u043e\u0433\u043e \u043b\u044c\u043e\u0434\u043e\u0432\u0438\u043a\u043e\u0432\u043e\u0433\u043e \u043f\u0435\u0440\u0456\u043e\u0434\u0443 \u0454\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u044c\u043a\u0438\u0439 \u0431\u0443\u043a \u043f\u043e\u0448\u0438\u0440\u0438\u0432\u0441\u044f \u0437 \u043a\u0456\u043b\u044c\u043a\u043e\u0445 \u0456\u0437\u043e\u043b\u044c\u043e\u0432\u0430\u043d\u0438\u0445 \u0442\u0435\u0440\u0438\u0442\u043e\u0440\u0456\u0439 \u0432 \u0410\u043b\u044c\u043f\u0430\u0445, \u041a\u0430\u0440\u043f\u0430\u0442\u0430\u0445, \u0414\u0456\u043d\u0430\u0440\u0438\u0434\u0430\u0445, \u0421\u0435\u0440\u0435\u0434\u0437\u0435\u043c\u043d\u043e\u043c\u043e\u0440\u2019\u0457 \u0442\u0430 \u041f\u0456\u0440\u0435\u043d\u0435\u044f\u0445 \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c \u043a\u043e\u0440\u043e\u0442\u043a\u043e\u0433\u043e \u043f\u0435\u0440\u0456\u043e\u0434\u0443 \u0432 \u043a\u0456\u043b\u044c\u043a\u0430 \u0442\u0438\u0441\u044f\u0447 \u0440\u043e\u043a\u0456\u0432 \u0443 \u043f\u0440\u043e\u0446\u0435\u0441\u0456, \u044f\u043a\u0438\u0439 \u0432\u0441\u0435 \u0449\u0435 \u0442\u0440\u0438\u0432\u0430\u0454. \u0423\u0441\u043f\u0456\u0448\u043d\u0435 \u043f\u043e\u0448\u0438\u0440\u0435\u043d\u043d\u044f \u043d\u0430 \u0446\u0456\u043b\u0438\u0439 \u043a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442 \u043f\u043e\u0432\u2019\u044f\u0437\u0430\u043d\u0435 \u0437 \u043f\u0440\u0438\u0441\u0442\u043e\u0441\u043e\u0432\u0430\u043d\u0456\u0441\u0442\u044e \u0434\u0435\u0440\u0435\u0432\u0430 \u0442\u0430 \u0442\u043e\u043b\u0435\u0440\u0430\u043d\u0442\u043d\u0456\u0441\u0442\u044e \u0434\u043e \u0440\u0456\u0437\u043d\u0438\u0445 \u043a\u043b\u0456\u043c\u0430\u0442\u0438\u0447\u043d\u0438\u0445, \u0433\u0435\u043e\u0433\u0440\u0430\u0444\u0456\u0447\u043d\u0438\u0445 \u0456 \u0444\u0456\u0437\u0438\u0447\u043d\u0438\u0445 \u0443\u043c\u043e\u0432.","year2":"2007","title2":"Lavaux, \u0412\u0438\u043d\u043e\u0433\u0440\u0430\u0434\u043d\u0456 \u0442\u0435\u0440\u0430\u0441\u0438","text2":"\u0412\u0438\u043d\u043e\u0433\u0440\u0430\u0434\u043d\u0456 \u0442\u0435\u0440\u0430\u0441\u0438 \u041b\u0430\u0432\u043e \u043f\u0440\u043e\u0441\u0442\u044f\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e \u043d\u0430 30 \u043a\u043c \u0432\u0437\u0434\u043e\u0432\u0436 \u043f\u0456\u0432\u0434\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u0456\u0432\u043d\u0456\u0447\u043d\u043e\u0433\u043e \u0431\u0435\u0440\u0435\u0433\u0430 \u0416\u0435\u043d\u0435\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u043e\u0437\u0435\u0440\u0430 \u0432\u0456\u0434 \u0428\u0438\u043b\u044c\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u0437\u0430\u043c\u043a\u0443 \u0434\u043e \u0441\u0445\u0456\u0434\u043d\u043e\u0457 \u043e\u043a\u043e\u043b\u0438\u0446\u0456 \u041b\u043e\u0437\u0430\u043d\u043d\u0438 \u0432 \u0440\u0435\u0433\u0456\u043e\u043d\u0456 \u0412\u043e, \u043e\u0445\u043e\u043f\u043b\u044e\u044e\u0447\u0438 \u043d\u0438\u0436\u043d\u0456 \u0441\u0445\u0438\u043b\u0438 \u0433\u0456\u0440\u0441\u044c\u043a\u043e\u0433\u043e \u0441\u0445\u0438\u043b\u0443 \u043c\u0456\u0436 \u0441\u0435\u043b\u0430\u043c\u0438 \u0442\u0430 \u043e\u0437\u0435\u0440\u043e\u043c. \u0425\u043e\u0447\u0430 \u0454 \u0434\u0435\u044f\u043a\u0456 \u0434\u043e\u043a\u0430\u0437\u0438 \u0442\u043e\u0433\u043e, \u0449\u043e \u0432\u0438\u043d\u043e\u0433\u0440\u0430\u0434\u043d\u0456 \u043b\u043e\u0437\u0438 \u0432\u0438\u0440\u043e\u0449\u0443\u0432\u0430\u043b\u0438\u0441\u044f \u0432 \u0446\u044c\u043e\u043c\u0443 \u0440\u0430\u0439\u043e\u043d\u0456 \u0432 \u0440\u0438\u043c\u0441\u044c\u043a\u0456 \u0447\u0430\u0441\u0438, \u043d\u0438\u043d\u0456\u0448\u043d\u0456 \u0432\u0438\u043d\u043e\u0433\u0440\u0430\u0434\u043d\u0456 \u0442\u0435\u0440\u0430\u0441\u0438 \u043c\u043e\u0436\u043d\u0430 \u043f\u0440\u043e\u0441\u0442\u0435\u0436\u0438\u0442\u0438 \u0434\u043e 11 \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f, \u043a\u043e\u043b\u0438 \u0431\u0435\u043d\u0435\u0434\u0438\u043a\u0442\u0438\u043d\u0441\u044c\u043a\u0456 \u0442\u0430 \u0446\u0438\u0441\u0442\u0435\u0440\u0446\u0456\u0430\u043d\u0441\u044c\u043a\u0456 \u043c\u043e\u043d\u0430\u0441\u0442\u0438\u0440\u0456 \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u044e\u0432\u0430\u043b\u0438 \u0442\u0435\u0440\u0438\u0442\u043e\u0440\u0456\u044e. \u0426\u0435 \u0432\u0438\u0434\u0430\u0442\u043d\u0438\u0439 \u043f\u0440\u0438\u043a\u043b\u0430\u0434 \u0431\u0430\u0433\u0430\u0442\u043e\u0432\u0456\u043a\u043e\u0432\u043e\u0457 \u0432\u0437\u0430\u0454\u043c\u043e\u0434\u0456\u0457 \u043c\u0456\u0436 \u043b\u044e\u0434\u044c\u043c\u0438 \u0442\u0430 \u0457\u0445 \u0441\u0435\u0440\u0435\u0434\u043e\u0432\u0438\u0449\u0435\u043c, \u0440\u043e\u0437\u0440\u043e\u0431\u043b\u0435\u043d\u0438\u0439 \u0434\u043b\u044f \u043e\u043f\u0442\u0438\u043c\u0456\u0437\u0430\u0446\u0456\u0457 \u043c\u0456\u0441\u0446\u0435\u0432\u0438\u0445 \u0440\u0435\u0441\u0443\u0440\u0441\u0456\u0432 \u0434\u043b\u044f \u0432\u0438\u0440\u043e\u0431\u043d\u0438\u0446\u0442\u0432\u0430 \u0432\u0438\u0441\u043e\u043a\u043e \u0446\u0456\u043d\u043e\u0432\u0430\u043d\u043e\u0433\u043e \u0432\u0438\u043d\u0430, \u044f\u043a\u0435 \u0437\u0430\u0432\u0436\u0434\u0438 \u0431\u0443\u043b\u043e \u0432\u0430\u0436\u043b\u0438\u0432\u0438\u043c \u0434\u043b\u044f \u0435\u043a\u043e\u043d\u043e\u043c\u0456\u043a\u0438."},{"year1":"2008","title1":"\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0441\u044c\u043a\u0430 \u0442\u0435\u043a\u0442\u043e\u043d\u0456\u0447\u043d\u0430 \u0430\u0440\u0435\u043d\u0430 \u0421\u0430\u0440\u0434\u043e\u043d\u0430","text1":"\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0441\u044c\u043a\u0430 \u0442\u0435\u043a\u0442\u043e\u043d\u0456\u0447\u043d\u0430 \u0430\u0440\u0435\u043d\u0430 \u0421\u0430\u0440\u0434\u043e\u043d\u0430 \u0432 \u043f\u0456\u0432\u043d\u0456\u0447\u043d\u043e-\u0441\u0445\u0456\u0434\u043d\u0456\u0439 \u0447\u0430\u0441\u0442\u0438\u043d\u0456 \u043a\u0440\u0430\u0457\u043d\u0438 \u0437\u0430\u0439\u043c\u0430\u0454 \u0433\u0456\u0440\u0441\u044c\u043a\u0443 \u0442\u0435\u0440\u0438\u0442\u043e\u0440\u0456\u044e \u043f\u043b\u043e\u0449\u0435\u044e 32 850 \u0433\u0430, \u043d\u0430 \u044f\u043a\u0456\u0439 \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u043e \u0441\u0456\u043c \u0432\u0435\u0440\u0448\u0438\u043d, \u0449\u043e \u043f\u0456\u0434\u043d\u0456\u043c\u0430\u044e\u0442\u044c\u0441\u044f \u0432\u0438\u0449\u0435 3000 \u043c. \u0426\u044f \u0442\u0435\u0440\u0438\u0442\u043e\u0440\u0456\u044f \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0443\u0454 \u0432\u0438\u043d\u044f\u0442\u043a\u043e\u0432\u0438\u0439 \u043f\u0440\u0438\u043a\u043b\u0430\u0434 \u0433\u043e\u0440\u043e\u0443\u0442\u0432\u043e\u0440\u0435\u043d\u043d\u044f \u0447\u0435\u0440\u0435\u0437 \u0437\u0456\u0442\u043a\u043d\u0435\u043d\u043d\u044f \u043a\u043e\u043d\u0442\u0438\u043d\u0435\u043d\u0442\u0456\u0432 \u0456 \u043c\u0430\u0454 \u0432\u0456\u0434\u043c\u0456\u043d\u043d\u0456 \u0433\u0435\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0456 \u0440\u043e\u0437\u0440\u0456\u0437\u0438 \u0447\u0435\u0440\u0435\u0437 \u0442\u0435\u043a\u0442\u043e\u043d\u0456\u0447\u043d\u0438\u0439 \u043d\u0430\u0441\u0443\u0432, \u0442\u043e\u0431\u0442\u043e \u043f\u0440\u043e\u0446\u0435\u0441, \u0437\u0430 \u0434\u043e\u043f\u043e\u043c\u043e\u0433\u043e\u044e \u044f\u043a\u043e\u0433\u043e \u0441\u0442\u0430\u0440\u0456\u0448\u0456, \u0433\u043b\u0438\u0431\u0448\u0456 \u043f\u043e\u0440\u043e\u0434\u0438 \u043f\u0435\u0440\u0435\u043d\u043e\u0441\u044f\u0442\u044c\u0441\u044f \u043d\u0430 \u043c\u043e\u043b\u043e\u0434\u0448\u0456, \u0434\u0440\u0456\u0431\u043d\u0456\u0448\u0456. \u041c\u0456\u0441\u0446\u0435 \u0432\u0438\u0440\u0456\u0437\u043d\u044f\u0454\u0442\u044c\u0441\u044f \u0447\u0456\u0442\u043a\u0438\u043c \u0442\u0440\u0438\u0432\u0438\u043c\u0456\u0440\u043d\u0438\u043c \u0432\u0438\u044f\u0432\u043b\u0435\u043d\u043d\u044f\u043c \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440 \u0456 \u043f\u0440\u043e\u0446\u0435\u0441\u0456\u0432, \u044f\u043a\u0456 \u0445\u0430\u0440\u0430\u043a\u0442\u0435\u0440\u0438\u0437\u0443\u044e\u0442\u044c \u0446\u0435 \u044f\u0432\u0438\u0449\u0435, \u0456 \u0454 \u043a\u043b\u044e\u0447\u043e\u0432\u0438\u043c \u043c\u0456\u0441\u0446\u0435\u043c \u0434\u043b\u044f \u0433\u0435\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0438\u0445 \u043d\u0430\u0443\u043a \u0437 18 \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f. \u0413\u043b\u0430\u0440\u0443\u0441\u0441\u044c\u043a\u0456 \u0410\u043b\u044c\u043f\u0438 \u2014 \u0446\u0435 \u043b\u044c\u043e\u0434\u043e\u0432\u0438\u043a\u043e\u0432\u0456 \u0433\u043e\u0440\u0438, \u0449\u043e \u0440\u0456\u0437\u043a\u043e \u043f\u0456\u0434\u043d\u043e\u0441\u044f\u0442\u044c\u0441\u044f \u043d\u0430\u0434 \u0432\u0443\u0437\u044c\u043a\u0438\u043c\u0438 \u0434\u043e\u043b\u0438\u043d\u0430\u043c\u0438 \u0440\u0456\u0447\u043e\u043a \u0456 \u0454 \u043c\u0456\u0441\u0446\u0435\u043c \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448\u043e\u0433\u043e \u043f\u0456\u0441\u043b\u044f\u043b\u044c\u043e\u0434\u043e\u0432\u0438\u043a\u043e\u0432\u043e\u0433\u043e \u0437\u0441\u0443\u0432\u0443 \u0432 \u0446\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0430\u043b\u044c\u043f\u0456\u0439\u0441\u044c\u043a\u043e\u043c\u0443 \u0440\u0435\u0433\u0456\u043e\u043d\u0456.","year2":"2008","title2":"\u0420\u0435\u0442\u0456\u0439\u0441\u044c\u043a\u0430 \u0437\u0430\u043b\u0456\u0437\u043d\u0438\u0446\u044f \u0432 \u043b\u0430\u043d\u0434\u0448\u0430\u0444\u0442\u0430\u0445 \u0410\u043b\u044c\u0431\u0443\u043b\u0430/\u0411\u0435\u0440\u043d\u0456\u043d\u0430","text2":"\u0420\u0435\u0442\u0456\u0439\u0441\u044c\u043a\u0430 \u0437\u0430\u043b\u0456\u0437\u043d\u0438\u0446\u044f \u0432 \u043b\u0430\u043d\u0434\u0448\u0430\u0444\u0442\u0430\u0445 \u0410\u043b\u044c\u0431\u0443\u043b\u0430/\u0411\u0435\u0440\u043d\u0456\u043d\u0430 \u043e\u0431\u2019\u0454\u0434\u043d\u0443\u0454 \u0434\u0432\u0456 \u0456\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u0456 \u0437\u0430\u043b\u0456\u0437\u043d\u0438\u0447\u043d\u0456 \u043b\u0456\u043d\u0456\u0457, \u044f\u043a\u0456 \u043f\u0435\u0440\u0435\u0442\u0438\u043d\u0430\u044e\u0442\u044c \u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0441\u044c\u043a\u0456 \u0410\u043b\u044c\u043f\u0438 \u0447\u0435\u0440\u0435\u0437 \u0434\u0432\u0430 \u043f\u0435\u0440\u0435\u0432\u0430\u043b\u0438. \u0412\u0456\u0434\u043a\u0440\u0438\u0442\u0430 \u0432 1904 \u0440\u043e\u0446\u0456 \u043b\u0456\u043d\u0456\u044f \u0410\u043b\u044c\u0431\u0443\u043b\u0430 \u0432 \u043f\u0456\u0432\u043d\u0456\u0447\u043d\u043e-\u0437\u0430\u0445\u0456\u0434\u043d\u0456\u0439 \u0447\u0430\u0441\u0442\u0438\u043d\u0456 \u043c\u0430\u0454\u0442\u043a\u0443 \u043c\u0430\u0454 \u0434\u043e\u0432\u0436\u0438\u043d\u0443 67 \u043a\u043c. \u0412\u0456\u043d \u043c\u0430\u0454 \u0432\u0440\u0430\u0436\u0430\u044e\u0447\u0438\u0439 \u043d\u0430\u0431\u0456\u0440 \u0441\u043f\u043e\u0440\u0443\u0434, \u0432\u043a\u043b\u044e\u0447\u0430\u044e\u0447\u0438 42 \u0442\u0443\u043d\u0435\u043b\u0456 \u0442\u0430 \u043a\u0440\u0438\u0442\u0456 \u0433\u0430\u043b\u0435\u0440\u0435\u0457 \u0442\u0430 144 \u0432\u0456\u0430\u0434\u0443\u043a\u0438 \u0442\u0430 \u043c\u043e\u0441\u0442\u0438. 61-\u043a\u0456\u043b\u043e\u043c\u0435\u0442\u0440\u043e\u0432\u0430 \u043b\u0456\u043d\u0456\u044f \u043f\u0435\u0440\u0435\u0432\u0430\u043b\u0443 \u0411\u0435\u0440\u043d\u0456\u043d\u0430 \u0432\u043a\u043b\u044e\u0447\u0430\u0454 13 \u0442\u0443\u043d\u0435\u043b\u0456\u0432 \u0456 \u0433\u0430\u043b\u0435\u0440\u0435\u0439, \u0430 \u0442\u0430\u043a\u043e\u0436 52 \u0432\u0456\u0430\u0434\u0443\u043a\u0438 \u0442\u0430 \u043c\u043e\u0441\u0442\u0438. \u0412\u043b\u0430\u0441\u043d\u0456\u0441\u0442\u044c \u0454 \u043f\u0440\u0438\u043a\u043b\u0430\u0434\u043e\u043c \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f \u0437\u0430\u043b\u0456\u0437\u043d\u0438\u0446\u0456 \u0434\u043b\u044f \u043f\u043e\u0434\u043e\u043b\u0430\u043d\u043d\u044f \u0456\u0437\u043e\u043b\u044f\u0446\u0456\u0457 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u044c \u0443 \u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u0438\u0445 \u0410\u043b\u044c\u043f\u0430\u0445 \u043d\u0430 \u043f\u043e\u0447\u0430\u0442\u043a\u0443 20-\u0433\u043e \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f, \u0449\u043e \u043c\u0430\u043b\u043e \u0441\u0435\u0440\u0439\u043e\u0437\u043d\u0438\u0439 \u0456 \u0442\u0440\u0438\u0432\u0430\u043b\u0438\u0439 \u0441\u043e\u0446\u0456\u0430\u043b\u044c\u043d\u043e-\u0435\u043a\u043e\u043d\u043e\u043c\u0456\u0447\u043d\u0438\u0439 \u0432\u043f\u043b\u0438\u0432 \u043d\u0430 \u0436\u0438\u0442\u0442\u044f \u0432 \u0433\u043e\u0440\u0430\u0445. \u0412\u0456\u043d \u044f\u0432\u043b\u044f\u0454 \u0441\u043e\u0431\u043e\u044e \u0432\u0438\u0434\u0430\u0442\u043d\u0438\u0439 \u0442\u0435\u0445\u043d\u0456\u0447\u043d\u0438\u0439, \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u0438\u0439 \u0442\u0430 \u0435\u043a\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0438\u0439 \u0430\u043d\u0441\u0430\u043c\u0431\u043b\u044c \u0456 \u0432\u0442\u0456\u043b\u044e\u0454 \u0432 \u0441\u043e\u0431\u0456 \u0434\u043e\u0441\u044f\u0433\u043d\u0435\u043d\u043d\u044f \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u0438 \u0442\u0430 \u0446\u0438\u0432\u0456\u043b\u044c\u043d\u043e\u0433\u043e \u0431\u0443\u0434\u0456\u0432\u043d\u0438\u0446\u0442\u0432\u0430 \u0432 \u0433\u0430\u0440\u043c\u043e\u043d\u0456\u0457 \u0437 \u043b\u0430\u043d\u0434\u0448\u0430\u0444\u0442\u0430\u043c\u0438, \u0447\u0435\u0440\u0435\u0437 \u044f\u043a\u0456 \u0432\u043e\u043d\u0438 \u043f\u0440\u043e\u0445\u043e\u0434\u044f\u0442\u044c."},{"year1":"2009","title1":"\u041b\u0430-\u0428\u043e-\u0434\u0435-\u0424\u043e\u043d / \u041b\u0435-\u041b\u043e\u043a\u043b\u044c, \u0433\u043e\u0434\u0438\u043d\u043d\u0438\u043a\u043e\u0432\u0435 \u043c\u0456\u0441\u0442\u043e\u0431\u0443\u0434\u0443\u0432\u0430\u043d\u043d\u044f","text1":"\u041c\u0456\u0441\u0446\u0435 \u043f\u043b\u0430\u043d\u0443\u0432\u0430\u043d\u043d\u044f \u0433\u043e\u0434\u0438\u043d\u043d\u0438\u043a\u043e\u0432\u043e\u0433\u043e \u0432\u0438\u0440\u043e\u0431\u043d\u0438\u0446\u0442\u0432\u0430 \u041b\u0430-\u0428\u043e-\u0434\u0435-\u0424\u043e\u043d/\u041b\u0435-\u041b\u043e\u043a\u043b\u044c \u0441\u043a\u043b\u0430\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0437 \u0434\u0432\u043e\u0445 \u043c\u0456\u0441\u0442, \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0438\u0445 \u043d\u0435\u043f\u043e\u0434\u0430\u043b\u0456\u043a \u043e\u0434\u043d\u0435 \u0432\u0456\u0434 \u043e\u0434\u043d\u043e\u0433\u043e \u0443 \u0432\u0456\u0434\u0434\u0430\u043b\u0435\u043d\u043e\u043c\u0443 \u0441\u0435\u0440\u0435\u0434\u043e\u0432\u0438\u0449\u0456 \u0432 \u0433\u043e\u0440\u0430\u0445 \u042e\u0440\u0430 \u0432 \u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0456\u0457, \u043d\u0430 \u0437\u0435\u043c\u043b\u0456, \u043f\u043e\u0433\u0430\u043d\u043e \u043f\u0440\u0438\u0441\u0442\u043e\u0441\u043e\u0432\u0430\u043d\u0456\u0439 \u0434\u043b\u044f \u0437\u0435\u043c\u043b\u0435\u0440\u043e\u0431\u0441\u0442\u0432\u0430. \u0407\u0445 \u043f\u043b\u0430\u043d\u0443\u0432\u0430\u043d\u043d\u044f \u0442\u0430 \u0431\u0443\u0434\u0456\u0432\u043b\u0456 \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u044e\u0442\u044c \u043f\u043e\u0442\u0440\u0435\u0431\u0443 \u0433\u043e\u0434\u0438\u043d\u043d\u0438\u043a\u0430\u0440\u0456\u0432 \u0443 \u0440\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0456\u0439 \u043e\u0440\u0433\u0430\u043d\u0456\u0437\u0430\u0446\u0456\u0457. \u041c\u0456\u0441\u0442\u0430, \u0441\u043f\u043b\u0430\u043d\u043e\u0432\u0430\u043d\u0456 \u043d\u0430 \u043f\u043e\u0447\u0430\u0442\u043a\u0443 19 \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f \u043f\u0456\u0441\u043b\u044f \u043c\u0430\u0441\u0448\u0442\u0430\u0431\u043d\u0438\u0445 \u043f\u043e\u0436\u0435\u0436, \u0437\u0430\u0432\u0434\u044f\u0447\u0443\u0432\u0430\u043b\u0438 \u0441\u0432\u043e\u0457\u043c \u0456\u0441\u043d\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0446\u0456\u0439 \u043e\u0434\u043d\u0456\u0439 \u0433\u0430\u043b\u0443\u0437\u0456. \u0407\u0445 \u0440\u043e\u0437\u043c\u0456\u0449\u0435\u043d\u043d\u044f \u0432\u0437\u0434\u043e\u0432\u0436 \u0432\u0456\u0434\u043a\u0440\u0438\u0442\u043e\u0457 \u0441\u0445\u0435\u043c\u0438 \u043f\u0430\u0440\u0430\u043b\u0435\u043b\u044c\u043d\u0438\u0445 \u0441\u043c\u0443\u0433, \u043d\u0430 \u044f\u043a\u0438\u0445 \u043f\u0435\u0440\u0435\u043c\u0456\u0448\u0430\u043d\u0456 \u0436\u0438\u0442\u043b\u043e\u0432\u0456 \u0431\u0443\u0434\u0438\u043d\u043a\u0438 \u0442\u0430 \u043c\u0430\u0439\u0441\u0442\u0435\u0440\u043d\u0456, \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u0454 \u043f\u043e\u0442\u0440\u0435\u0431\u0438 \u043c\u0456\u0441\u0446\u0435\u0432\u043e\u0457 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u0438 \u0433\u043e\u0434\u0438\u043d\u043d\u0438\u043a\u0430\u0440\u0441\u0442\u0432\u0430, \u044f\u043a\u0430 \u0431\u0435\u0440\u0435 \u0441\u0432\u0456\u0439 \u043f\u043e\u0447\u0430\u0442\u043e\u043a \u0443 17 \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u0456 \u0439 \u200b\u200b\u0436\u0438\u0432\u0435 \u0439 \u0441\u044c\u043e\u0433\u043e\u0434\u043d\u0456. \u041d\u0430 \u0441\u0430\u0439\u0442\u0456 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0456 \u0432\u0438\u0434\u0430\u0442\u043d\u0456 \u043f\u0440\u0438\u043a\u043b\u0430\u0434\u0438 \u043c\u043e\u043d\u043e\u043f\u0440\u043e\u043c\u0438\u0441\u043b\u043e\u0432\u0438\u0445 \u0432\u0438\u0440\u043e\u0431\u043d\u0438\u0447\u0438\u0445 \u043c\u0456\u0441\u0442, \u044f\u043a\u0456 \u0434\u043e\u0431\u0440\u0435 \u0437\u0431\u0435\u0440\u0435\u0433\u043b\u0438\u0441\u044f \u0442\u0430 \u0432\u0441\u0435 \u0449\u0435 \u0434\u0456\u044e\u0442\u044c. \u041c\u0456\u0441\u0442\u043e\u0431\u0443\u0434\u0443\u0432\u0430\u043d\u043d\u044f \u043e\u0431\u043e\u0445 \u043c\u0456\u0441\u0442 \u0432\u0440\u0430\u0445\u0443\u0432\u0430\u043b\u043e \u043f\u0435\u0440\u0435\u0445\u0456\u0434 \u0432\u0456\u0434 \u043a\u0443\u0441\u0442\u0430\u0440\u043d\u043e\u0433\u043e \u0432\u0438\u0440\u043e\u0431\u043d\u0438\u0446\u0442\u0432\u0430 \u043a\u0443\u0441\u0442\u0430\u0440\u043d\u043e\u0457 \u043f\u0440\u043e\u043c\u0438\u0441\u043b\u043e\u0432\u043e\u0441\u0442\u0456 \u0434\u043e \u0431\u0456\u043b\u044c\u0448 \u043a\u043e\u043d\u0446\u0435\u043d\u0442\u0440\u043e\u0432\u0430\u043d\u043e\u0433\u043e \u0444\u0430\u0431\u0440\u0438\u0447\u043d\u043e\u0433\u043e \u0432\u0438\u0440\u043e\u0431\u043d\u0438\u0446\u0442\u0432\u0430 \u043a\u0456\u043d\u0446\u044f 19-\u0433\u043e \u0456 20-\u0433\u043e \u0441\u0442\u043e\u043b\u0456\u0442\u044c. \u041a\u0430\u0440\u043b \u041c\u0430\u0440\u043a\u0441 \u043e\u043f\u0438\u0441\u0430\u0432 \u043c\u0456\u0441\u0442\u043e \u041b\u0430-\u0428\u043e-\u0434\u0435-\u0424\u043e\u043d \u044f\u043a \xab\u0432\u0435\u043b\u0438\u043a\u0435 \u0437\u0430\u0432\u043e\u0434\u0441\u044c\u043a\u0435 \u043c\u0456\u0441\u0442\u043e\xbb \u0432 \xab\u041a\u0430\u043f\u0456\u0442\u0430\u043b\u0456\xbb, \u0434\u0435 \u0432\u0456\u043d \u043f\u0440\u043e\u0430\u043d\u0430\u043b\u0456\u0437\u0443\u0432\u0430\u0432 \u043f\u043e\u0434\u0456\u043b \u043f\u0440\u0430\u0446\u0456 \u0432 \u0433\u043e\u0434\u0438\u043d\u043d\u0438\u043a\u043e\u0432\u0456\u0439 \u043f\u0440\u043e\u043c\u0438\u0441\u043b\u043e\u0432\u043e\u0441\u0442\u0456 \u042e\u0440\u0438.","year2":"2011","title2":"\u0414\u043e\u0456\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u0456 \u043f\u0430\u043b\u044c\u043e\u0432\u0456 \u0431\u0443\u0434\u0438\u043d\u043a\u0438 \u043d\u0430\u0432\u043a\u043e\u043b\u043e \u0410\u043b\u044c\u043f","text2":"\u0426\u044f \u0441\u0435\u0440\u0456\u0439\u043d\u0430 \u0432\u043b\u0430\u0441\u043d\u0456\u0441\u0442\u044c \u0456\u0437 111 \u043d\u0435\u0432\u0435\u043b\u0438\u043a\u0438\u0445 \u043e\u043a\u0440\u0435\u043c\u0438\u0445 \u0434\u0456\u043b\u044f\u043d\u043e\u043a \u043e\u0445\u043e\u043f\u043b\u044e\u0454 \u0437\u0430\u043b\u0438\u0448\u043a\u0438 \u0434\u043e\u0456\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u0438\u0445 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u044c \u043d\u0430 \u043f\u0430\u043b\u044f\u0445 (\u0430\u0431\u043e \u0431\u0443\u0434\u0438\u043d\u043a\u0456\u0432 \u043d\u0430 \u043f\u0430\u043b\u044f\u0445) \u0432 \u0410\u043b\u044c\u043f\u0430\u0445 \u0456 \u043d\u0430\u0432\u043a\u043e\u043b\u043e \u043d\u0438\u0445, \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u0438\u0445 \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u043d\u043e \u0437 5000 \u043f\u043e 500 \u0440\u0456\u043a \u0434\u043e \u043d\u0430\u0448\u043e\u0457 \u0435\u0440\u0438. \u043d\u0430 \u0431\u0435\u0440\u0435\u0433\u0430\u0445 \u043e\u0437\u0435\u0440, \u0440\u0456\u0447\u043e\u043a \u0430\u0431\u043e \u0432\u043e\u0434\u043d\u043e-\u0431\u043e\u043b\u043e\u0442\u043d\u0438\u0445 \u0443\u0433\u0456\u0434\u044c. \u0420\u043e\u0437\u043a\u043e\u043f\u043a\u0438, \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0456 \u043b\u0438\u0448\u0435 \u0432 \u0434\u0435\u044f\u043a\u0438\u0445 \u043c\u0456\u0441\u0446\u044f\u0445, \u0434\u0430\u043b\u0438 \u0434\u043e\u043a\u0430\u0437\u0438, \u044f\u043a\u0456 \u0434\u0430\u044e\u0442\u044c \u0437\u043c\u043e\u0433\u0443 \u0437\u0440\u043e\u0437\u0443\u043c\u0456\u0442\u0438 \u0436\u0438\u0442\u0442\u044f \u0432 \u0434\u043e\u0456\u0441\u0442\u043e\u0440\u0438\u0447\u043d\u0456 \u0447\u0430\u0441\u0438 \u043f\u0456\u0434 \u0447\u0430\u0441 \u043d\u0435\u043e\u043b\u0456\u0442\u0443 \u0442\u0430 \u0431\u0440\u043e\u043d\u0437\u043e\u0432\u043e\u0433\u043e \u0432\u0456\u043a\u0443 \u0432 \u0410\u043b\u044c\u043f\u0456\u0439\u0441\u044c\u043a\u0456\u0439 \u0404\u0432\u0440\u043e\u043f\u0456 \u0442\u0430 \u0442\u0435, \u044f\u043a \u0433\u0440\u043e\u043c\u0430\u0434\u0438 \u0432\u0437\u0430\u0454\u043c\u043e\u0434\u0456\u044f\u043b\u0438 \u0437 \u043d\u0430\u0432\u043a\u043e\u043b\u0438\u0448\u043d\u0456\u043c \u0441\u0435\u0440\u0435\u0434\u043e\u0432\u0438\u0449\u0435\u043c. \u041f\'\u044f\u0442\u0434\u0435\u0441\u044f\u0442 \u0448\u0456\u0441\u0442\u044c \u043e\u0431\'\u0454\u043a\u0442\u0456\u0432 \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0456 \u0432 \u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0456\u0457. \u041f\u043e\u0441\u0435\u043b\u0435\u043d\u043d\u044f \u0454 \u0443\u043d\u0456\u043a\u0430\u043b\u044c\u043d\u043e\u044e \u0433\u0440\u0443\u043f\u043e\u044e \u0432\u0438\u043d\u044f\u0442\u043a\u043e\u0432\u043e \u0434\u043e\u0431\u0440\u0435 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u0438\u0445 \u0456 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u043e \u0431\u0430\u0433\u0430\u0442\u0438\u0445 \u0430\u0440\u0445\u0435\u043e\u043b\u043e\u0433\u0456\u0447\u043d\u0438\u0445 \u043f\u0430\u043c\u2019\u044f\u0442\u043e\u043a, \u044f\u043a\u0456 \u0454 \u043e\u0434\u043d\u0438\u043c \u0456\u0437 \u043d\u0430\u0439\u0432\u0430\u0436\u043b\u0438\u0432\u0456\u0448\u0438\u0445 \u0434\u0436\u0435\u0440\u0435\u043b \u0434\u043b\u044f \u0432\u0438\u0432\u0447\u0435\u043d\u043d\u044f \u0440\u0430\u043d\u043d\u0456\u0445 \u0430\u0433\u0440\u0430\u0440\u043d\u0438\u0445 \u0441\u0443\u0441\u043f\u0456\u043b\u044c\u0441\u0442\u0432 \u0443 \u0440\u0435\u0433\u0456\u043e\u043d\u0456."},{"year1":"2016","title1":"\u0410\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u0430 \u0440\u043e\u0431\u043e\u0442\u0430 \u041b\u0435 \u041a\u043e\u0440\u0431\u044e\u0437\u044c\u0454, \u0432\u0438\u0434\u0430\u0442\u043d\u0438\u0439 \u0432\u043d\u0435\u0441\u043e\u043a \u0443 \u0441\u0443\u0447\u0430\u0441\u043d\u0438\u0439 \u0440\u0443\u0445","text1":"\u0412\u0438\u0431\u0440\u0430\u043d\u0456 \u0437 \u0440\u043e\u0431\u0456\u0442 \u041b\u0435 \u041a\u043e\u0440\u0431\u044e\u0437\u044c\u0454, 17 \u0441\u0430\u0439\u0442\u0456\u0432, \u0449\u043e \u0441\u043a\u043b\u0430\u0434\u0430\u044e\u0442\u044c \u0446\u044e \u0442\u0440\u0430\u043d\u0441\u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0443 \u0441\u0435\u0440\u0456\u0439\u043d\u0443 \u0432\u043b\u0430\u0441\u043d\u0456\u0441\u0442\u044c, \u0440\u043e\u0437\u0442\u0430\u0448\u043e\u0432\u0430\u043d\u0456 \u0432 \u0441\u0435\u043c\u0438 \u043a\u0440\u0430\u0457\u043d\u0430\u0445 \u0456 \u0454 \u0441\u0432\u0456\u0434\u0447\u0435\u043d\u043d\u044f\u043c \u0432\u0438\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043d\u043e\u0432\u043e\u0457 \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u043e\u0457 \u043c\u043e\u0432\u0438, \u044f\u043a\u0430 \u043f\u043e\u0440\u0443\u0448\u0438\u043b\u0430 \u043c\u0438\u043d\u0443\u043b\u0435. \u0412\u043e\u043d\u0438 \u0431\u0443\u043b\u0438 \u043f\u043e\u0431\u0443\u0434\u043e\u0432\u0430\u043d\u0456 \u043f\u0440\u043e\u0442\u044f\u0433\u043e\u043c \u043f\u0456\u0432\u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f \u0432 \u0445\u043e\u0434\u0456 \u0442\u043e\u0433\u043e, \u0449\u043e \u041b\u0435 \u041a\u043e\u0440\u0431\u044e\u0437\u044c\u0454 \u043e\u043f\u0438\u0441\u0430\u0432 \u044f\u043a \xab\u0434\u043e\u0441\u043b\u0456\u0434\u0436\u0435\u043d\u043d\u044f \u043f\u0430\u0446\u0456\u0454\u043d\u0442\u0456\u0432\xbb. \u041a\u0430\u043f\u0456\u0442\u043e\u043b\u0456\u0439\u0441\u044c\u043a\u0438\u0439 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441 \u0443 \u0427\u0430\u043d\u0434\u0456\u0433\u0430\u0440\u0445\u0443 (\u0406\u043d\u0434\u0456\u044f), \u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u043c\u0443\u0437\u0435\u0439 \u0437\u0430\u0445\u0456\u0434\u043d\u043e\u0433\u043e \u043c\u0438\u0441\u0442\u0435\u0446\u0442\u0432\u0430 \u0432 \u0422\u043e\u043a\u0456\u043e (\u042f\u043f\u043e\u043d\u0456\u044f), \u0411\u0443\u0434\u0438\u043d\u043e\u043a \u0434\u043e\u043a\u0442\u043e\u0440\u0430 \u041a\u0443\u0440\u0443\u0447\u0435\u0442\u0442\u0430 \u0432 \u041b\u0430-\u041f\u043b\u0430\u0442\u0456 (\u0410\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u0430) \u0456 \u0411\u0443\u0434\u0438\u043d\u043e\u043a \u043f\u0440\u043e\u0436\u0438\u0432\u0430\u043d\u043d\u044f \u0432 \u041c\u0430\u0440\u0441\u0435\u043b\u0456 (\u0424\u0440\u0430\u043d\u0446\u0456\u044f) \u0432\u0456\u0434\u043e\u0431\u0440\u0430\u0436\u0430\u044e\u0442\u044c \u0440\u0456\u0448\u0435\u043d\u043d\u044f, \u044f\u043a\u0456 \u0441\u0443\u0447\u0430\u0441\u043d\u0438\u0439 \u0423 20-\u043c\u0443 \u0441\u0442\u043e\u043b\u0456\u0442\u0442\u0456 \u0446\u0435\u0439 \u0440\u0443\u0445 \u043f\u0440\u0430\u0433\u043d\u0443\u0432 \u0437\u0430\u0441\u0442\u043e\u0441\u0443\u0432\u0430\u0442\u0438 \u043d\u043e\u0432\u0456 \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u0456 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0456\u0457, \u0449\u043e\u0431 \u0437\u0430\u0434\u043e\u0432\u043e\u043b\u044c\u043d\u0438\u0442\u0438 \u043f\u043e\u0442\u0440\u0435\u0431\u0438 \u0441\u0443\u0441\u043f\u0456\u043b\u044c\u0441\u0442\u0432\u0430. \u0426\u0456 \u0448\u0435\u0434\u0435\u0432\u0440\u0438 \u0442\u0432\u043e\u0440\u0447\u043e\u0433\u043e \u0433\u0435\u043d\u0456\u044f \u0442\u0430\u043a\u043e\u0436 \u0441\u0432\u0456\u0434\u0447\u0430\u0442\u044c \u043f\u0440\u043e \u0456\u043d\u0442\u0435\u0440\u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u0456\u0437\u0430\u0446\u0456\u044e \u0430\u0440\u0445\u0456\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u043e\u0457 \u043f\u0440\u0430\u043a\u0442\u0438\u043a\u0438 \u043f\u043e \u0432\u0441\u0456\u0439 \u043f\u043b\u0430\u043d\u0435\u0442\u0456.","year2":"","title2":"","text2":""}]')}}]);